CREATE DATABASE clarke_energia;

CREATE TABLE usuarios (
    id serial primary key,
    nome text not null,
    email text not null unique,
    cep int not null,
    cidade text not null,
    senha text not null,
);

CREATE TABLE fornecedores (
    id serial primary key,
    nome text not null,
    logo text not null,
    estado text,
    custo_kwh decimal (6,5) not null,
    minimo_kwh int not null,
    qtd_clientes int,
    avaliacao_media int
);


